function WorkPiece({ title, description }) {
  return (
    <div className="w-full md:w-1/2 mb-12 lg:pr-12">
      <div className="md:mr-2">
        <div className="relative pb-2/3 bg-gray-200 rounded"></div>
        <h3 className="text-2xl mt-4 mb-2 font-bold">{title}</h3>
        <p className="text-xl text-gray-900 leading-snug">{description}</p>
      </div>
    </div>
  );
}

export default WorkPiece;
